function Footer() {
    return (
        <div className="footer">
            <p>Designed and Built by Michelle Gleave</p>
            <a href="http://www.github.com/mmgleave">
            <img src={DiGithubFull}/></a>
            <a href="http://www.instagram.com/mishkab0b">
            <img src={ Io}/></a>
        </div>
    )
};

export default Footer;
